import React from 'react'

function InputGroup(label,type,name) {
  return (
  <div>
       <div className="mb-3">
                <label for="email" className="form-label">{label}</label>
                <input type={type} className="form-control" name={name}/>
            </div>
            </div>
  )
}

export default InputGroup
